DROP TABLE IF EXISTS `Calculation16K`;
CREATE TABLE `Calculation16K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Structure16K`;
CREATE TABLE `Structure16K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Composition16K`;
CREATE TABLE `Composition16K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `BandGap16K`;
CREATE TABLE `BandGap16K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
